<script>
    document.addEventListener('DOMContentLoaded', function test() {
        document.getElementById('kc_'+localStorage.getItem('open_kc')).setAttribute('checked', 'true')
        update_status_tb()
        update_status_kran()
        setInterval(update_status_tb ,10000)
        setInterval(update_status_kran ,10000)
    })
    function update_modal_tb_kc(id) {
        $.ajax({
            url: '/dataModalWindowMKU/'+id,
            type: 'GET',
            success: (data_to_modal) => {
                var bad_param = data_to_modal['full_name']['bad_param']
                try{
                    bad_param = bad_param.split(',')
                }catch (e) {                }
                // var bad_param = data_to_modal['full_name']['bad_param']
                var modal_dialog = document.getElementById('openModalInfo').getElementsByClassName('modal-dialog')[0]
                modal_dialog.style.marginTop = '25vh'
                modal_dialog.style.maxWidth = '700px'
                var header = document.getElementById('openModalInfo').getElementsByClassName('modal-header')[0]
                header.style.padding = '0px 15px 0px 15px'
                header.innerText = ''
                var h3 = document.createElement('h4')
                h3.innerHTML = `${data_to_modal['full_name']['value']}`
                var a = document.createElement('a')
                a.innerHTML = `×`
                a.setAttribute('href', '#close')
                a.setAttribute('class', 'close')
                header.appendChild(h3)
                header.appendChild(a)
                var tbody = document.getElementById('openModalInfo').getElementsByTagName('tbody')[0]
                tbody.innerText = ''
                var keys = Object.keys(data_to_modal)
                var tr = document.createElement('tr')
                tr.innerHTML = `<td style="text-align: left; color: black">${data_to_modal['descstatus']['desc']}</td><td style="text-align: left">${data_to_modal['descstatus']['value']}</td>`
                tr.classList.add(data_to_modal['descstatus']['class'] + '_tr')
                tbody.appendChild(tr);
                delete data_to_modal['full_name']
                delete data_to_modal['descstatus']
                for (var key of keys){
                    try{
                        var tr = document.createElement('tr')
                        tr.id = 'key_bad_param_is_'+key
                        if (data_to_modal[key]['value'] !== "" && data_to_modal[key]['value'] !== null && data_to_modal[key]['value'] !== 'null'){
                            tr.innerHTML = `<td>${data_to_modal[key]['desc']}</td><td>${data_to_modal[key]['value']}</td>`
                        }else {
                            tr.innerHTML = `<td>${data_to_modal[key]['desc']}</td><td>н/д</td>`
                        }
                        // tr.innerHTML = `<td style="text-align: left">${data_to_modal[key]['desc']}</td><td style="text-align: left">${data_to_modal[key]['value']}</td>`
                        tbody.appendChild(tr);
                    }catch (e){

                    }
                }
                var tr = document.createElement('tr')
                tr.innerHTML = `<td colspan="2"  style="text-align: center; border-left: none"><a href="/docs/directory_tb/edit/${id}" onclick="localStorage.setItem('redirect', '/ks')" style="">Редактировать</a></td>`
                tbody.appendChild(tr);
                try{
                    for (var bad of bad_param){
                        document.getElementById('key_bad_param_is_'+bad).style.fontWeight = '700'
                    }
                }catch (e) {

                }
            }, async: false,
        })
    }
    function update_modal_kran_kc(id){
        document.getElementById('kran_kc_modal').setAttribute('href', '/docs/directory_tb/edit/'+id)
        var kran = document.getElementsByClassName('kran_'+id)[0]
        if (kran.classList.contains('good')){
            var sost = 'открыт'
        }else if (kran.classList.contains('critical')){
            var sost = 'закрыт'
        }else if (kran.classList.contains('bad')){
            var sost = 'в промежуточном состоянии'
        }else if (kran.classList.contains('corrupt')){
            var sost = 'н/д'
        }
        document.getElementById('kran_kc_text').textContent = kran.getAttribute('title_kran') + ': '+sost
    }
    function update_status_tb(){
        var all_tb = document.querySelectorAll("[class*='tb_']")
        $.ajax({
            url: '/get_status_tb_kc',
            type: 'GET',
            success: (res) => {
                var regular = new RegExp('tb_', 'i')
                for(var tb of all_tb){
                    tb.classList.remove("critical")
                    tb.classList.remove("good")
                    tb.classList.remove("bad")
                    tb.classList.remove("repair")
                    tb.classList.remove("corrupt")
                    var class_list = tb.classList
                    var id_tb = Array.from(class_list).filter(one_class => one_class.match(regular))[0].split('_')[1];
                    tb.classList.add(res['class'][res['id_tb'].findIndex(i => i == id_tb)])
                }
            }, async: false,
        })
        $.ajax({
            url: '/get_p_t_kc',
            type: 'GET',
            success: (res) => {
                var arr = ['t_in', 't_out','p_in', 'p_out']
                for (var param of res){
                    try{
                        for (let i = 0; i < arr.length; i++) {
                            if (param['value_'+arr[i]]){
                                document.getElementById('kc_'+param['id_obj']+'_'+arr[i]).textContent = param['value_'+arr[i]]
                            }
                        }
                    }catch (e) {

                    }
                }
            }, async: false,
        })
    }
    function update_status_kran(){
        $.ajax({
            url: '/get_status_kran_kc',
            type: 'GET',
            success: (res) => {
                for(var kran of res){
                    var tb = document.getElementsByClassName('kran_'+kran['id_tb'])[0]
                    try{
                        tb.setAttribute('title_kran', kran['full_name_tb'])
                        tb.classList.remove("critical")
                        tb.classList.remove("good")
                        tb.classList.remove("bad")
                        tb.classList.remove("repair")
                        tb.classList.remove("corrupt")
                        if (Number(kran['status']) === 1){
                            tb.classList.add('good')
                        }else if(Number(kran['status']) === 2){
                            tb.classList.add('critical')
                        }else if(Number(kran['status']) === 0){
                            tb.classList.add('corrupt')
                        }else {
                            tb.classList.add('bad')
                        }
                    }catch (e) {

                    }
                }
            }, async: false,
        })
    }
</script>
